/**
 * Componente principal App
 * Configura as rotas e o layout geral da aplica√ß√£o
 * Gerencia a navega√ß√£o entre as diferentes p√°ginas do sistema
 */

import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link, useLocation } from 'react-router-dom';
import Home from './components/Home';
import Pessoas from './components/Pessoas';
import Categorias from './components/Categorias';
import Transacoes from './components/Transacoes';
import TotaisPorPessoa from './components/TotaisPorPessoa';
import TotaisPorCategoria from './components/TotaisPorCategoria';
import './styles/App.css';

/**
 * Componente de Layout com navega√ß√£o
 * Inclui o menu de navega√ß√£o e a √°rea de conte√∫do
 */
const Layout: React.FC<{ children: React.ReactNode }> = ({ children }) => {
  const location = useLocation();

  /**
   * Verifica se a rota atual est√° ativa
   * @param path - Caminho da rota
   * @returns true se a rota est√° ativa
   */
  const isActive = (path: string): boolean => {
    return location.pathname === path;
  };

  return (
    <div className="app-layout">
      {/* Header com navega√ß√£o */}
      <header className="app-header">
        <div className="header-content">
          <Link to="/" className="logo">
            <span className="logo-icon">üè†</span>
            <span className="logo-text">Controle Financeiro</span>
          </Link>
          
          <nav className="main-nav">
            <Link 
              to="/" 
              className={`nav-link ${isActive('/') ? 'active' : ''}`}
            >
              üè† Home
            </Link>
            <Link 
              to="/pessoas" 
              className={`nav-link ${isActive('/pessoas') ? 'active' : ''}`}
            >
              üë• Pessoas
            </Link>
            <Link 
              to="/categorias" 
              className={`nav-link ${isActive('/categorias') ? 'active' : ''}`}
            >
              üè∑Ô∏è Categorias
            </Link>
            <Link 
              to="/transacoes" 
              className={`nav-link ${isActive('/transacoes') ? 'active' : ''}`}
            >
              üí∞ Transa√ß√µes
            </Link>
            <Link 
              to="/totais-pessoa" 
              className={`nav-link ${isActive('/totais-pessoa') ? 'active' : ''}`}
            >
              üìä Totais por Pessoa
            </Link>
            <Link 
              to="/totais-categoria" 
              className={`nav-link ${isActive('/totais-categoria') ? 'active' : ''}`}
            >
              üìà Totais por Categoria
            </Link>
          </nav>
        </div>
      </header>

      {/* √Årea de conte√∫do principal */}
      <main className="app-main">
        {children}
      </main>

      {/* Footer */}
      <footer className="app-footer">
        <p>
          ¬© 2026 Sistema de Controle de Gastos Residenciais | 
          Desenvolvido com React & TypeScript
        </p>
      </footer>
    </div>
  );
};

/**
 * Componente principal da aplica√ß√£o
 * Configura o roteador e define todas as rotas do sistema
 */
const App: React.FC = () => {
  return (
    <Router>
      <Layout>
        <Routes>
          {/* Rota da p√°gina inicial */}
          <Route path="/" element={<Home />} />
          
          {/* Rotas de cadastro */}
          <Route path="/pessoas" element={<Pessoas />} />
          <Route path="/categorias" element={<Categorias />} />
          <Route path="/transacoes" element={<Transacoes />} />
          
          {/* Rotas de consulta/relat√≥rios */}
          <Route path="/totais-pessoa" element={<TotaisPorPessoa />} />
          <Route path="/totais-categoria" element={<TotaisPorCategoria />} />
          
          {/* Rota 404 - P√°gina n√£o encontrada */}
          <Route path="*" element={
            <div className="pagina-404">
              <h1>404</h1>
              <h2>P√°gina n√£o encontrada</h2>
              <p>A p√°gina que voc√™ est√° procurando n√£o existe.</p>
              <Link to="/" className="btn btn-primary">
                Voltar para Home
              </Link>
            </div>
          } />
        </Routes>
      </Layout>
    </Router>
  );
};

export default App;
